品牌發表日這天我不知道到底哭了幾次，沈澱了三天才準備好了把心情寫下來，因為這天給我的能量太滿太滿了，很想好好的表達我內心滿到爆炸的感動，深怕漏掉了什麼。
當初想辦這個品牌活動其實沒有想太多，因為工作的關係臨時決定要回台灣，所以就和團隊提議 不然來辦場活動吧？但我真的很怕沒什麼人來，畢竟我長年都待在美國，雖然認識不少台灣的KOL，但大多是沒有見過面的網友，我內心完全沒有自信能夠邀請各位KOL網友來參加我的活動，但是她們都是我非常欣賞的女性，在美國的生活遇到孤單、低落的時候，都是她們的文章與創作伴我渡過著生活的高低起伏。
對我來說，她們不只是KOL網友而已，她們發揮著自己的影響力與力量感染著我、支撐著我、給了我力量，帶領我一次一次的學習與成長，成就了今天的我及我的品牌。
所以當我看到大家因為我而聚集在這裡的時候，我直接現場大噴淚
看著在我眼前閃閃發光著的她們，我明白了，這個品牌不是因為我而生的，是為了我們想傳遞的光而生的，是為了所有對自我感到迷惘的女性而生的。
現場的KOL朋友們都非常優秀，各自在自己經營的社群中發揮著影響力感染身邊的人們。我想，我們會互相吸引，是因為我們都有著共同的特質 — 我是誰由我自己決定，堅持做自己想做的事、不畏懼外在的聲音，勇敢的成為自己想要的樣子。
看著這些現場活動的花絮照片，看見每個人都散發著各自的光芒，我的內心又一次一次的再度被感動
https://www.facebook.com/ultd.studio?__cft__[0]=AZU_6vHhrhbhm9h7QnvfChLXv0NWSS07ELeXN4DoLNVR-4PWkAMhmLQYxszx5BbOPmyYaAY-lqX8SwOCyjOUU1y1z1YdFBH6LthpL13rdtSTXNigsHyBCS17cyKv7_RDkJ-A7M0JlYdeLX9Clw2TCkrR&amp;__tn__=-]K-R
當天我們安排了瑜伽活動及頌缽療癒，最後的來賓禮贈送的是 @mosa_homecollection 的香氛蠟燭，涵義為— 希望能透過Ultd Studio的運動、舞蹈、瑜伽、冥想、舒緩、自我成長課程，帶妳點亮自己內心的光。
「只要持續的相信自己，找到自己內在的光，我就是無限的。」 Be Unlimited. 
最後感謝  @ness.wellness 平台的頌缽老師Lorina，透過頌缽音療讓現場每位KOL都感到無比舒壓，也感謝我們Ultd Studio的瑜伽老師凱西 @cathydudu.yoga ，為我們設計了好棒的瑜伽flow，既好玩又有運動到，我和可彤一起玩的雙人背部伸展真的很舒服！也感謝  
https://www.facebook.com/whatolove/?__cft__[0]=AZU_6vHhrhbhm9h7QnvfChLXv0NWSS07ELeXN4DoLNVR-4PWkAMhmLQYxszx5BbOPmyYaAY-lqX8SwOCyjOUU1y1z1YdFBH6LthpL13rdtSTXNigsHyBCS17cyKv7_RDkJ-A7M0JlYdeLX9Clw2TCkrR&amp;__tn__=kK-R
最後，最最最感謝的是我強大的團隊，在我三週前臨時起意辦這場活動時，我們的品牌正在趕著籌備上線最忙之際，大家在最高壓的狀態下還是幫我們把活動辦出來了
這場品牌體驗會，不只是傳達我們的理念，更重要的是能透過運動感受當下的自己，被溫暖、被療癒，我們不需要完美，只需要找回心中最純粹的自己，希望Ultd能夠成為你運動及人生旅程上的旅伴，陪著你成長、看著你發光
歡迎免費試上我們圍繞著理念而設計的課程，現在到3/31前還有第二波早鳥優惠！
